import Layout from '../Components/Layout';

const Projects = () => (

    <Layout >
        <div className='Projects'>
            <h1>Projects page </h1>

            <p> Render a list of projets to check</p>
            <p> - list should provide certain quick reference info about each project</p>

        </div>

    </Layout>

    );

    export default Projects;
